import React, { Component } from "react";
import Layout from "../../components/Layout";
import { Form } from "semantic-ui-react";

class AddUser extends Component {
  state = {
    value: "",
  };
  render() {
    return (
      <Layout>
        <Form></Form>
      </Layout>
    );
  }
}

export default AddUser;
